export default {
  name: "UpdateContacts",
  data() {
    return {
      text: '',
      telefon: ''
    };
  },
  methods: {
    onSubmit(e) {
      e.preventDefault();
      if (!this.text) {
        alert("Add your ContactDetails! ");
        return;
      }
      const updateContact = {
        text: this.text,
        telefon: this.telefon
      };
      this.$emit("update-contact", updateContact);
      this.text = '';
      this.telefon = '';
    }
  }
};
